import React from "react";
import { Box } from "@mui/material";
import Button from "@mui/material/Button";
import { useContext } from "react";
import { filterContext } from "./VoiceChatBot";
import { useNavigate } from "react-router-dom";

export default function ChatData({ chat, aiData }) {
  const navigate = useNavigate();
  const filterData = useContext(filterContext);
  console.log("filter ", filterData);
  return (
    <Box
      sx={{
        width: "100%",
      }}
    >
      {chat.map((text, index) => (
        <Box
          key={text}
          sx={{
            display: "flex",
            flexDirection: "column",
            margin: 2,
          }}
        >
          <p>
            <strong>User - </strong> {text}
          </p>
          <p style={{ alignSelf: "flex-end" }}>
            <strong>AI - </strong> {aiData[index]}
          </p>

          <hr />
        </Box>
      ))}
      <a href="/details" target="_blank">
        <Button
          sx={{ width: "40%" }}
          // onClick={() => navigate("/details")}
          variant="contained"
        >
          All IP Info
        </Button>
      </a>

      <Button
        sx={{ width: "40%", marginX: 10 }}
        onClick={() => navigate("/filteredIp")}
        variant="contained"
        target="_blank"
        disabled={filterData.length <= 1 ? true : false}
      >
        Filtered IP
      </Button>
    </Box>
  );
}
